function StreamingDataView(t){this.position=0,this.view=new DataView(t)}StreamingDataView.prototype.rewind=function(){this.position=0},StreamingDataView.prototype.setPosition=function(t){this.position=t},StreamingDataView.prototype.getInt8=function(){return this.view.getInt8(this.position++)},StreamingDataView.prototype.getUint8=function(){return this.view.getUint8(this.position++)},StreamingDataView.prototype.getInt16=function(t){var i=this.view.getInt16(this.position,t);return this.position+=2,i},StreamingDataView.prototype.getUint16=function(t){var i=this.view.getUint16(this.position,t);return this.position+=2,i},StreamingDataView.prototype.getInt32=function(t){var i=this.view.getInt32(this.position,t);return this.position+=4,i},StreamingDataView.prototype.getUint32=function(t){var i=this.view.getUint32(this.position,t);return this.position+=4,i},StreamingDataView.prototype.getFloat32=function(t){var i=this.view.getFloat32(this.position,t);return this.position+=4,i},StreamingDataView.prototype.getFloat64=function(t){var i=this.view.getFloat64(this.position,t);return this.position+=8,i},StreamingDataView.prototype.getBuffer=function(t){var i=this.getUint32(t),e=new Uint8Array(this.view.buffer).slice(this.position,this.position+i);return this.position+=i,e.buffer},StreamingDataView.prototype.getString=function(t){return new TextDecoder("utf8").decode(this.getBuffer(t))};